apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://api.prod.paidit.se
  name: prod.paidit.se
contexts:
- context:
    cluster: prod.paidit.se
    user: joakim
  name: prod.paidit.se
current-context: prod.paidit.se
kind: Config
preferences: { }
users:
- name: joakim
  user:
    exec:
      apiVersion: client.authentication.k8s.io/v1beta1
      args:
      - token
      - -i
      - prod.paidit.se
      - -r
      - arn:aws:iam::505676538145:role/KubernetesAdmin
      command: aws-iam-authenticator
      env: null
      provideClusterInfo: false
